// import React from 'react'
// import NavBar from './NavBar'
// import './Header.css'

// const Header = () => {
//   return (
//     <div>
//         <NavBar />
//         <div style={{height: '432px', backgroundColor: '#E8FCFE'}}></div>
//         <div className='line1'></div>
//         <div className='line2'></div>
//         <div className='line3'></div>
//         <div className='line4'></div>
//         <div className='line5'></div>
//         <div className='line6'></div>
//         <div className='input-rectangle'>

//         </div>
//     </div> 
//   )
// }

// export default Header

import "./Header.css";
const Header = () => {
  return (
    <div className="line-parent">
      <img className="frame-child" alt="" src="/line-7.svg" />
      <img className="image-7-icon" alt="" src="/image-7@2x.png" />
      <div className="frame-item" />
      <div className="frame-inner" />
      <img className="line-icon" alt="" src="/line-5.svg" />
      <div className="line-div" />
      <img className="frame-child1" alt="" src="/line-3.svg" />
      <div className="enhance-your-skills">
        Enhance your skills by learning courses from the faculty in top
        universities
      </div>
      <div className="popular-machine">
        Popular : Machine Learning by Harvard, xyz course from Stanford
      </div>
      <b className="find-your-dream-container">
        <span className="find-your-dream-container1">
          <span>{`Find your `}</span>
          <span className="dream-course">dream course</span>
        </span>
      </b>
      <div className="rectangle-div" />
      <img className="frame-icon" alt="" src="/frame.svg" />
      <input
        className="course-name-or"
        type="text"
        placeholder="Course Name or keyword"
      />
      <input className="university" type="text" placeholder="University" />
      <div className="frame-child2" />
      <div className="frame-child3" />
      <div className="frame-child4" />
      <img className="frame-icon1" alt="" src="/frame1.svg" />
      <button className="rectangle-parent">
        <div className="group-child" />
        <img className="frame-icon2" alt="" src="/frame3.svg" />
        <div className="search">Search</div>
      </button>
      <img className="icon-check" alt="" src="/-icon-check.svg" />
      <nav className="rectangle-group" id="nav-bar-internal">
        <div className="group-item" />
        <div className="home">{`Home `}</div>
        <b className="courses">Courses</b>
        <div className="research">Research</div>
        <div className="interview">Interview</div>
        <div className="kashish-gandhi">Kashish Gandhi</div>
        <div className="internship-portal">Internship Portal</div>
        <img className="kashish-1-icon" alt="" src="/kashish-1@2x.png" />
        <div className="group-inner" />
        <img
          className="icon-chevron-down"
          alt=""
          src="/-icon-chevron-down.svg"
        />
      </nav>
      <img className="frame-child5" alt="" src="/line-2.svg" />
    </div>
  );
};

export default Header;
